        { name: "EMR", description: "Big data processing using Hadoop/Spark" },
        { name: "Kinesis", description: "Real-time data streaming" },
        { name: "QuickSight", description: "Business intelligence service" },
        { name: "Glue", description: "ETL and data catalog service" },
      ],
    },
    {
      category: "Machine Learning",
      items: [
        { name: "SageMaker", description: "Build, train, and deploy ML models" },
        { name: "Comprehend", description: "Natural language processing" },
        { name: "Rekognition", description: "Image and video analysis" },
        { name: "Lex", description: "Build conversational interfaces" },
        { name: "Polly", description: "Text-to-speech service" },
        { name: "Translate", description: "Language translation service" },
      ],
    },
    {
      category: "Developer Tools",
      items: [
        { name: "CodeCommit", description: "Git repository service" },
        { name: "CodeBuild", description: "Build and test code" },
        { name: "CodeDeploy", description: "Automate deployments" },
        { name: "CodePipeline", description: "Continuous integration & delivery" },
        { name: "Cloud9", description: "Cloud IDE" },
      ],
    },
    {
      category: "Management & Governance",
      items: [
        { name: "CloudWatch", description: "Monitoring and observability" },
        { name: "CloudTrail", description: "Track API calls & changes" },
        { name: "Config", description: "Resource inventory and compliance" },
        { name: "Systems Manager", description: "Operational management service" },
        { name: "Trusted Advisor", description: "Optimize AWS resources" },
      ],
    },
    {
      category: "Application Integration",
      items: [
        { name: "SNS", description: "Push notifications & messaging" },
        { name: "SQS", description: "Message queue service" },
